dymodels)\n","library(Matrix)"]},{"cell_type":"markdown","id":"4897b6a5","metadata":{"_cell_guid":"17fa8a34-53cb-49f9-886f-753c5e1c769b","_uuid":"52a31302-a601-40d7-9d76-69622b9c0631","papermill":{"duration":0.011531,"end_time":"2024-02-09T22:16:27.788982","exception":false,"start_time":"2024-02-09T22:16:27.777451","status":"completed"},"tags":[]},"source":["# Week 4 Project Plan\n","\n","1. __Team Members:__ Michael Wise & Jairus Martinez\n","2. __Data Source:__ [COVID-19 comorbidities](https://www.kaggle.com/datasets/meirnizri/covid19-dataset)\n","\n","### Project plan rubric\n","1. Identify team members (as applicable) and data source __(5 points)__.\n","2. Create exploratory graphs to identify relationships between variables __(10 points)__.\n","3. Express at least 2-3 different (statistical) questions you will explore with the data and perform a basic inferential statistical analysis to answer at least one of the questions __(5 points)__.\n","\n","# Columns:\n","The dataset was provided by the [Mexican government](https://datos.gob.mx/busca/dataset/informacion-referente-a-casos-covid-19-en-mexico). This dataset contains an enormous number of anonymized patient-related information including pre-conditions. The raw dataset consists of 21 unique features and 1,048,576 unique patients. In the Boolean features, 1 means \"yes\" and 2 means \"no\". values as 97 and 99 are missing data.\n","​\n","- __sex__: 1 for female and 2 for male.\n","- __age__: of the patient.\n","- __classification__: covid test findings. Values 1-3 mean that the patient was diagnosed with covid in different degrees.\n","    - 4 or higher means that the patient is not a carrier of covid or that the test is inconclusive.\n","- __patient type__: type of care the patient received in the unit. \n","    - 1 for returned home and 2 for hospitalization.\n","- __pneumonia__: whether the patient already have air sacs inflammation or not.\n","- __pregnancy__: whether the patient is pregnant or not.\n","- __diabetes__: whether the patient has diabetes or not.\n","- __copd__: Indicates whether the patient has Chronic obstructive pulmonary disease or not.\n","- __asthma__: whether the patient has asthma or not.\n","- __inmsupr__: whether the patient is immunosuppressed or not.\n","- __hypertension__: whether the patient has hypertension or not.\n","- __cardiovascular__: whether the patient has heart or blood vessels related disease.\n","- __renal chronic__: whether the patient has chronic renal disease or not.\n","- __other disease__: whether the patient has other disease or not.\n","- __obesity__: whether the patient is obese or not.\n","- __tobacco__: whether the patient is a tobacco user.\n","- __usmr__: Indicates whether the patient treated medical units of the first, second or third level.\n","- __medical unit__: type of institution of the National Health System that provided the care.\n","- __intubed__: whether the patient was connected to the ventilator.\n","- __icu__: Indicates whether the patient had been admitted to an Intensive Care Unit.\n","- __date died__: If the patient died indicate the date of death, and 9999-99-99 otherwise.\n","- __has_died__: Added column. If patient is deceased or not.\n","\n","\n","### __Note__:\n","- For Boolean features, 1 means \"yes\" and 2 means \"no\".\n","    - Boolean features will be converted to 1's and 0's\n","- Missing values are represented as either 97, 98, or 99\n","    - Missing values will be converted to NAs"]},{"cell_type":"markdown","id":"89bc6922","metadata":{"_cell_guid":"ab5f1f5e-8e8b-4014-bb07-a886bf78d301","_uuid":"048249e0-be7e-4ad8-9d98-e477bcf22b52","papermill":{"duration":0.011194,"end_time":"2024-02-09T22:16:27.811415","exception":false,"start_time":"2024-02-09T22:16:27.800221","status":"completed"},"tags":[]},"source":["# Load Data"]},{"cell_type":"code","execution_count":2,"id":"e96c12b6","metadata":{"_cell_guid":"903ae4b2-1415-4272-82ea-44f29aa54f57","_uuid":"813e2432-6fd6-48fa-981a-d0da2ae887c3","