 and drop date_died column\n","df <- df %>%\n","  mutate(has_died = ifelse(mask_valid_dates, 1, 0)) %>%\n","  select(-date_died)\n","\n","\n","# get categorical_cols to use for later EDA\n","# categorical_cols are columns besides age since age is continuous\n","categorical_cols <- setdiff(names(df), 'age')\n","\n","# replace all vlues of 97/98/99 with NA\n","df[df == 97 | df == 98 | df == 99] <- NA\n","\n","# get binary_cols (subset of categorical_cols) for later EDA/data preprocessing\n","# clasiffication_final and medical_unit are excluded since they have more than 2 categories\n","binary_cols <- setdiff(categorical_cols, c('clasiffication_final', 'medical_unit'))\n","\n","# replace '2' values as '0' for binary_cols\n","df[binary_cols][df[binary_cols] == 2] <- 0\n","\n","# creat multiclass_cols for EDA\n","multiclass_cols <- setdiff(categorical_cols, binary_cols)\n","\n","# create lifestyle_conditions column\n","df <- df %>%\n","  mutate(lifestyle_conditions = diabetes + obesity + tobacco)\n","\n","# create medical_conditions\n","df <- df %>%\n","  mutate(medical_conditions = pneumonia + diabetes + copd \n","         + asthma + inmsupr + hipertension + other_disease +\n","        cardiovascular + obesity + renal_chronic)"]},{"cell_type":"markdown","id":"7eae037e","metadata":{"_cell_guid":"5cd1bd09-47fc-4984-ad14-c0e3b91d041b","_uuid":"eb3b1505-81e0-4428-9166-113860948fdd","papermill":{"duration":0.011197,"end_time":"2024-02-09T22:16:41.250868","exception":false,"start_time":"2024-02-09T22:16:41.239671","status":"completed"},"tags":[]},"source":["# View Data"]},{"cell_type":"code","execution_count":4,"id":"f8fced81","metadata":{"_cell_guid":"7ad38acb-2378-4713-b0a5-19cde4ca11df","_uuid":"5ea539ea-b5f8-41dc-b476-160a0b9e898e","collapsed":false,"execution":{"iopub.execute_input":"2024-02-09T22:16:41.278928Z","iopub.status.busy":"2024-02-09T22:16:41.277129Z","iopub.status.idle":"2024-02-09T22:16:41.327466Z","shell.execute_reply":"2024-02-09T22:16:41.32552Z"},"jupyter"