metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["plot_df = data.frame(df)\n","\n","for (col in multiclass_cols) {\n","  # remove NAs for the current col\n","  clean_col <- na.omit(plot_df[, col])\n","\n","  # bar chart\n","  bar_chart <- ggplot(data.frame(col = clean_col), aes(x = col)) +\n","    geom_bar(stat = 'count', fill = \"blue\", color = \"black\", alpha = 0.7) +\n","    labs(title = paste(\"Bar Chart of\", col), x = col, y = \"Count\")\n","\n","  print(bar_chart)\n","}"]},{"cell_type":"markdown","id":"e2c8f989","metadata":{"_cell_guid":"7ec01571-90af-4dc8-ba50-e5908177d628","_uuid":"5b041fdd-5e31-4e45-9346-e4a23f83698a","papermill":{"duration":0.024969,"end_time":"2024-02-09T22:17:14.370346","exception":false,"start_time":"2024-02-09T22:17:14.345377","status":"completed"},"tags":[]},"source":["# Exploratory graphs to identify relationships between variables \n","__(10 points)__.\n","\n","### Which variables have relationships?\n","\n","- __sex__: 1 for female and 2 for male.\n","- __age__: of the patient.\n","- __classification__: covid test findings. Values 1-3 mean that the patient was diagnosed with covid in different degrees.\n","    - 4 or higher means that the patient is not a carrier of covid or that the test is inconclusive.\n","- __patient type__: type of care the patient received in the unit. \n","    - 1 for returned home and 2 for hospitalization.\n","- __pneumonia__: whether the patient already have air sacs inflammation or not.\n","- __pregnancy__: whether the patient is pregnant or not.\n","- __diabetes__: whether the patient has diabetes or not.\n","- __copd__: Indicates whether the patient has Chronic obstructive pulmonary disease or not.\n","- __asthma__: whether the patient has asthma or not.\n","- __inmsupr__: whether the patient is immunosuppressed or not.\n","- __hypertension__: whether the patient has hypertension or not.\n","- __cardiovascular__: whether the patient has heart or blood vessels related disease.\n","- __renal chronic__: whether the patient has chronic renal disease or not.\n","- __other disease__: whether the patient has other disease or not.\n","- __obesity__: whether the patient is obese or not.\n","- __tobacco__: whether the patient is a tobacco user.\n","- __usmr__: Indicates whether the patient treated medical units of the first, second or third level.\n","- __medical unit__: type of institution of the National Health System that provided the care.\n","- __intubed__: whether the patient was connected to the ventilator.\n","- __icu__: Indicates whether the patient had been admitted to an Intensive Care Unit.\n","- __has_died__: Added column. If patient is deceased or not.\n","\n","\n","### Expectations for some level of correlation?\n","\n","- sex, pregnant \n","- classification, patient_type, icu, usmr, has_died\n","- copd, tobacco, intubed, patient_type, classification\n","- pneumonia, copd, intubed, icu, date_died, patient_type, classification\n","- obesity, icu, date_died, patient_type, intubed\n","- hypertension, cardiovascular\n","- renal_chronic, patient_type, icu, has_died\n","- inmsupr, icu, patient_type, has_died, classification\n","- classification, has_died, icu, patient_type"]},{"cell_type":"code","execution_count":13,"id":"aa8460d1","metadata":{"execution":{"iopub.execute_input":"2024-02-09T22:17:14.425472Z","iopub.status.busy":"2024-02-09T22:17:14.423294Z","iopub.status.idle":"2024-02-09T22:17:15.549643Z","shell.execute_reply":"2024-02-09T22:17:15.547477Z"},"papermill":{"duration":1.156342,"end_time":"2024-02-09T22:17:15.552536","exception":false,"start_time":"2024-02-09T22:17:14.396194","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2CU9eH48c8ll52QAJEpIktQcaCiouK2Sh04a7XuVXetWOvCgaNO3Otnta17\n1j2+YutedVSte+DEhSKQANn3+yMYI4RwAZLDT16vf8w983PP+SRvnluJVCoVAAD45cvK9AAA\nAFgyhB0AQCSEHQBAJIQdAEAkhB0AQCSEHQBAJIQdAEAkhB0AQ