2-09T22:17:25.803447","exception":false,"start_time":"2024-02-09T22:17:25.773461","status":"completed"},"tags":[]},"source":["# Statistical Questions \n","Express at least 2-3 different (statistical) questions you will explore with the data and perform a basic inferential statistical analysis to answer at least one of the questions \n","\n","__(5 points)__.\n","\n","Example Questions:\n","1. __Which features are the most relevant to predicting death?__\n","2. __Is having number of co-morbidities as a feature dependent on death?__\n","3. Are there significant differences in the distribution of COVID-19 severity between different age groups?\n","4. What is the correlation between intubation (intubed) and admission to the Intensive Care Unit (icu)\n","5. __Is there a significant difference in the proportion of deaths between different medical units (medical unit)?__\n","6. Is there a significant difference in the age distribution between male and female COVID-19 patients?"]},{"cell_type":"markdown","id":"b4318c57","metadata":{"papermill":{"duration":0.029753,"end_time":"2024-02-09T22:17:25.86437","exception":false,"start_time":"2024-02-09T22:17:25.834617","status":"completed"},"tags":[]},"source":["### Which features are the most relevant to predicting death?\n","\n","Logistic Regression Reference for Inference:\n","1. https://openintro-ims.netlify.app/inf-model-logistic\n","2. https://www.datacamp.com/tutorial/logistic-regression-R\n","3.https://pubmed.ncbi.nlm.nih.gov/21996075/#:~:text=Basic%20assumptions%20that%20must%20be,lack%20of%20strongly%20influential%20outliers.\n","4. https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7946807/\n","\n","Logistic Regression Assumptions to consider?\n","1. Dependent/response variable is binary\n","     - Yes\n","2. Little or no multicollinearity between the predictor/explanatory variables\n","    - Sex and Pregnant?\n","    - Honestly not entriely sure how to address this with categorical data\n","3. Linear relationship of independent variables to log odds\n","     - Visual test? Statistical test?\n","     - Not entirely sure how to approach this\n","4. Prefers large sample size\n","     - Yes, even with na.omit(df), the dataset is about 74,000 rows long\n","5. Problem with extreme outliers\n","     - None\n","     - Age is the only column with outliers but age is overall very normally distributed\n","6. Independent observations\n","     - Yes, I believe the individual observations/outcomes are independent since the death of one person most likely will not impact the death of another person (although genetic/environment factors may exist that affect dependence, I think overall, it is reasonable to assume independence. "]},{"cell_type":"code","execution_count":22,"id":"2a8e3027","metadata":{"execution":{"iopub.execute_input":"2024-02-09T22:17:25.968014Z","iopub.status.busy":"2024-02-09T22:17:25.966271Z","iopub.status.idle":"2024-02-09T22:17:29.554007Z","shell.execute_reply":"2024-02-09T22:17:29.54866Z"},"papermill":{"duration":3.626837,"end_time":"2024-02-09T22:17:29.560784","exception":false,"start_time":"2024-02-09T22:17:25.933947","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Loaded glmnet 4.1-8\n","\n"]},{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 23 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>term</th><th scope=col>estimate</th><th scope=col>penalty</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>(Intercept)         </td><td>-2.71441780</td><td>0</td></tr>\n","\t<tr><td>usmer               </td><td> 0.21297184</td><td>0</td></tr>\n","\t<tr><td>medical_unit        </td><td>-0.04415086</td><td>0</td></tr>\n","\t<tr><td>sex                 </td><td> 0.00000000</td><td>0</td></tr>\n","\t<tr><td>patient_type        </td><td> 0.00000000</td><td>0</td></tr>\n","\t<tr><td>intubed             </td><td> 2.41812334