n","\t asthma               & -0.2589828 & 0\\\\\n","\t other\\_disease        &  0.2029929 & 0\\\\\n","\t renal\\_chronic        &  0.4124519 & 0\\\\\n","\t clasiffication\\_final & -0.2014260 & 0\\\\\n","\t icu                  & -0.2296481 & 0\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A tibble: 11 × 3\n","\n","| term &lt;chr&gt; | estimate &lt;dbl&gt; | penalty &lt;dbl&gt; |\n","|---|---|---|\n","| (Intercept)          | -2.7144178 | 0 |\n","| usmer                |  0.2129718 | 0 |\n","| intubed              |  2.4181233 | 0 |\n","| pneumonia            |  0.5879458 | 0 |\n","| pregnant             | -0.8912017 | 0 |\n","| diabetes             |  0.2097956 | 0 |\n","| asthma               | -0.2589828 | 0 |\n","| other_disease        |  0.2029929 | 0 |\n","| renal_chronic        |  0.4124519 | 0 |\n","| clasiffication_final | -0.2014260 | 0 |\n","| icu                  | -0.2296481 | 0 |\n","\n"],"text/plain":["   term                 estimate   penalty\n","1  (Intercept)          -2.7144178 0      \n","2  usmer                 0.2129718 0      \n","3  intubed               2.4181233 0      \n","4  pneumonia             0.5879458 0      \n","5  pregnant             -0.8912017 0      \n","6  diabetes              0.2097956 0      \n","7  asthma               -0.2589828 0      \n","8  other_disease         0.2029929 0      \n","9  renal_chronic         0.4124519 0      \n","10 clasiffication_final -0.2014260 0      \n","11 icu                  -0.2296481 0      "]},"metadata":{},"output_type":"display_data"}],"source":["tidy(covid_model_tidymodel) %>% filter(estimate > 0.15 | estimate < -0.15)"]},{"cell_type":"markdown","id":"5a3dc10c","metadata":{"papermill":{"duration":0.034745,"end_time":"2024-02-09T22:17:29.762279","exception":false,"start_time":"2024-02-09T22:17:29.727534","status":"completed"},"tags":[]},"source":["### Preliminary Results\n","\n","The logistic regression models were conducted using two different implementations. The first uses the tidymodel package and the second uses the base R glm function. In the tidymodel results, the table displayed the coefficients and penalties for each predictor variable (all penalties were set to zero). The variables with the highest estimated coefficents (> 0.15 or < -0.15) were: \n","\n","- usmer\n","- intubed\n","- pneumonia\n","- pregnant\n","- diabetes\n","- asthma\n","- inmsupr\n","- other_disease\n","- renal_chronic\n","- classification_final\n","- icu\n","\n","For the base glm implementation provided coefficients, standard errors, z-values, and p-values for each term. However, issues with singularities were observed for variables such as sex and patient_type, leading to NA values. The variables with the highest estimated coefficents (> 0.15 or < -0.15) were: \n","\n","- usmer\n","- intubed\n","- pneumonia\n","- pregnant\n","- diabetes\n","- asthma\n","- inmsupr\n","- other_disease\n","- renal_chronic\n","- classification_final\n","- icu\n","\n","Across both implementations, the same variables were seen as influential predictors of the likelihood of mortality. Both implementations also had very similar estimated coefficents. In addition, all of these variabes got highly significant p-values (p-value < 0.001). Because of this,the features show promising significant associations with the outcome variable, 'has_died'. \n","\n","This preliminary inference may explain their importance in predicting deaths in COVID-19 patients. However, more exploration on logstic regression assumptions, imputation of missing values, regularization effects, looking at multicolinearity, and issues with singularities in the base glm model are needed for better understanding of relationship between the variables and the outcome. "]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":2633044,"sourceId":4504149,"sourceType":"datasetVersion"}],"dockerImageVersionId":30618,"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":